css:
:root {
  font-size: 16px;
}
.styleguide {
  position: relative;
  display: flex;
  flex-direction: column;
}
.styleguide-controls {
  position: absolute;
  right: 0.5rem;
  top: 0.5rem;
  z-index: 100;
}
.styleguide-header {
  padding: 0.75rem;
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.styleguide-header h1 {
  font-size: 2em;
  margin: 0 0 .5em 0;
  color: rgba(171, 178, 191, 0.6);
}
.styleguide-header p {
  font-size: 1.2em;
}
.styleguide-header p:last-of-type {
  margin-bottom: 0;
}
.styleguide-sections {
  flex: 1;
  overflow: auto;
}
.styleguide-sections > section {
  background-color: rgba(0, 0, 0, 0);
  padding: 0;
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
  border-top: none;
}
.styleguide-sections > section:last-child {
  margin-bottom: 0;
}
.styleguide-sections > section.collapsed {
  background-color: transparent;
}
.styleguide-sections > section.collapsed > .section-heading {
  display: block;
  margin: 0;
  padding-bottom: 0.75rem;
  color: rgba(171, 178, 191, 0.8);
}
.styleguide-sections > section.collapsed > .section-heading:hover {
  color: rgba(171, 178, 191, 0.6);
  background-color: rgba(0, 150, 136, 0.1);
}
.styleguide-sections > section.collapsed > .section-heading:active {
  background-color: transparent;
}
.styleguide-sections > section.collapsed > * {
  display: none;
}
.styleguide-sections .section-heading.section-heading {
  padding: 0.75rem 0.75rem 0 0.75rem;
  cursor: pointer;
  font-weight: normal;
  font-size: 1.8em;
  color: rgba(171, 178, 191, 0.6);
}
.styleguide-sections section > h2 {
  font-size: 1.5em;
  line-height: 1.2;
  margin: 1em 0.75rem 0 0.75rem;
  color: rgba(171, 178, 191, 0.6);
}
.styleguide-sections section > p {
  font-size: 1.1em;
  margin: 0.5em 0.75rem 1em 0.75rem;
}
.styleguide .example {
  display: flex;
  flex-wrap: wrap;
  border-radius: 0.125rem;
  padding: 0.25rem;
}
.styleguide .example .example-rendered,
.styleguide .example .example-code {
  position: relative;
  flex: 1 1 300px;
  min-width: 0;
  margin: 0.25rem;
  border-radius: 0.125rem;
  border: 1px solid rgba(0, 0, 0, 0.1);
}
.styleguide .example .example-rendered {
  padding: 0.5rem;
  background: transparent;
  overflow: hidden;
}
.styleguide .example .example-code {
  background-color: #282c34;
}
.styleguide .example .example-code pre {
  border: none;
  background-color: inherit;
}
